import React, { Component } from "react";
import Profile from "./Profile.js";
import "./Profile.css";

class Contact extends Component {
  render() {
    return (
      <div>
        <div id="align-top"></div>

        <div className="container">
        <div className="row">
          <Profile/>
          <Profile/>
          <Profile/>
          <Profile/>
        </div>
      </div>

      </div>
    );
  }
}

export default Contact;
